import React from 'react';
import { Item } from "../../types";

interface ItemLayOutProps {
    items: Item[];
}

const ItemLayOut: React.FC<ItemLayOutProps> = ({ items }) => {
    return (
        <main>
            <table>
                <thead>
                <tr>
                    <th>일련번호</th>
                    <th>상품명</th>
                    <th>가격</th>
                    <th>설명</th>
                    {/* 다른 상품 속성에 대한 추가적인 테이블 헤더를 추가하세요 */}
                </tr>
                </thead>
                <tbody>
                {items.map((item) => (
                    <tr key={item.id}>
                        <td>{item.serialNumber}</td>
                        <td>{item.name}</td>
                        <td>{item.price}</td>
                        <td>{item.description}</td>
                        {/* 다른 상품 속성에 대한 추가적인 테이블 셀을 렌더링하세요 */}
                    </tr>
                ))}
                </tbody>
            </table>
        </main>
    );
};

export default ItemLayOut;
